import Filter from "../component/Filter"
import List from "../component/List"

export default function Bookmark({filter, setFilter, setFilterHandler, book, setBook}){
  const items = book
  return(
    <article>
      <Filter filter={filter} setFilter={setFilter} setFilterHandler={setFilterHandler} items={items}/>
      <div className='itemContainer'>
        {book.map((item)=>{
          return <List book={book} setBook={setBook} item={item}/>
      })}
      </div>
    </article>
  )
}
